(2, 'Grain Moisture Meter LDS 1G', '/common/images/products/1699722022.png', NULL, '<p><span data-metadata=\"<!--(figmeta)eyJmaWxlS2V5Ijoibm5NRUxmbWJJWlVPTFhxdWE3STVkSiIsInBhc3RlSUQiOjUxMDQwOTIxNiwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)-->\"></span><span data-buffer=\"<!--(figma)(/figma)-->\"></span><span style=\"white-space-collapse: preserve;\"><b>Specifications :</b><br>Products analyzed: Cereal, oil seed and protein crops.<br><b>Benefits:</b><br>– Automatic temperature compensation<br>– Compatible with USB.<br>Moisture: 6-45%+/- 0,3 %<br>Temperature: 5 – 45°C+/- 0.1%<br><br><b>PRECISE AND EASY</b><br>• Choice of 17 pre-programmed seeds specially selected to meet the most common seed species;soft wheat, barley, rapeseed, sunflower, corn, durum wheat, oats, rye, peas, soybeans, triticale, sorghum.<br>• Shows the weight of the grain per hectolitre<br>• No pre-weighing<br>• LCD Screen Display<br>• Sample volume about 0.4 liters.<br><br>RELIABLE<br>• Humidity reading: 2% – 32% depending on the grain<br>• Temperature range 5 ° – 45 ° C<br>• Repeatability and accuracy +/- 0.3% for grain stored under normal conditions<br>• Display resolution: 0.1% humidity<br>• Moisture measurement compensation<br>• Vibration insensitive (no mechanical moving parts).</span><br></p>', '2023-11-11 11:00:22', '2023-11-11 11:00:22');
